import React, { useEffect, useState } from "react";

const ItemDetailContainer = () => {
  const [Items, SetItems] = useState([]);
  const items = [
    { Nombre: "Suscripcion Premium", Precio: "U$D" + " " + 5 },
    { Nombre: "Suscripcion Premium", Precio: "U$D" + " " + 5 },
  ];

  useEffect(() => {
    const itemDetail = new Promise((resolve, reject) => {
      resolve(items);
    });
    itemDetail
      .then((res) => {
        SetItems(res);
      })
      .catch((err) => {
        console.log(err);
      });

    console.log(Items);
  }, []);

  return <div>ItemDetailContainer</div>;
};

export default ItemDetailContainer;
